import { Container, Hero, Gradient, Content } from './AboutElements';
import Background from '../../Images/about-background.jpg';

const Home = () => {
    return (
        <Container>
            <Hero image={Background}>
                <Gradient>
                    <p style={{color: 'white'}}>This is the about page</p>
                </Gradient>
            </Hero>
            <Content>

            </Content>
        </Container>
    );
}

export default Home;
